import React from 'react'
import './App.css';
import main from './Main'
import {BrowserRouter,Routes,Route} from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path='/main' element={<main />}></Route>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
